import React from "react";

const BiogramCard = ({ person }) => {
  const { surname, name, imagePath, shortDesc } = person;
  return (
    <div className="border-2 border-black">
      <img
        alt={surname + name}
        src={process.env.PUBLIC_URL + `/avatars/${imagePath}`}
      />
      {person.name} {person.surname}
    </div>
  );
};

export default BiogramCard;
